import React, { useEffect } from 'react'
import { Link, useNavigate, useParams } from 'react-router-dom'
import { ContactServices } from '../../../Services/ContactServices'
const EditContact = () => {
  let navigate=useNavigate()
  let{contactId}=useParams()
  let[state,setState]=useState({
    loading:true,
    contact:{
      name:"",
      photo:"",
      mobile:"",
      email:"",
      title:"",
      company:"",
      groupId:""
    },
    errorMessage:""
  })

  useEffect(()=>{
    let promise=new Promise((res,rej)=>{
      setState({...state,loading:true})
      let response=ContactServices.getContact(contactId);
      res(response)
    })
    promise.then((res1)=>{
      setState({...state,loading:false,contact:res1.data})
    }).catch(()=>{
      setState({...state,loading:false,errorMessage:alert("Data is not found !!!")})
    })
  },[contactId])

  const updateHandle=(event)=>{
    setState({...state,contact:{
      ...state.contact,
       [event.target.name]:event.target.value
    }})
  }

  const submitHandle=(event)=>{
    event.preventDefault()
    let promise=new Promise((res,rej)=>{
      setState({...state,loading:true})
      let postData=ContactServices.updateContact(contacts,contactId);
      res(postData)
    })
    promise.then((res1)=>{
      if(res1){
        setState({...state,loading:false})
        navigate("/contacts/list",{replace:true})
      }else{
        setState({...state,loading:false})
        navigate("/contacts/edit",{replace:true})
      }
    }).catch(()=>{
      setState({...state,loading:false,errorMessage:alert("Data not found !!")},)
    })
  }

  return (
    <>
       <section className='edit-contact'>
        <div className="container p-3">
          <div className="row">
            <div className="col">
              <p className="h3 text-primary">Edit Contact</p>
              <p className='fst-italic'>Lorem ipsum dolor sit amet consectetur adipisicing elit. In natus ipsum doloribus rerum aperiam est quibusdam? Quam unde eligendi delectus veritatis molestias officiis omnis illum, soluta at. Deserunt, aliquid harum.</p>
            </div>
            <div className="row align-items-center">
              <div className="col-md-4">
                <form action="" onSubmit={submitHandle}>
                  <div className="mb-2">
                    <input type="text" value={contact.name} onChange={updateHandle} placeholder='NAME' className='form-control' />
                  </div>
                  <div className="mb-2">
                    <input type="text" onChange={updateHandle} placeholder='Photo Url' className='form-control' />
                  </div>
                  <div className="mb-2">
                    <input type="number" onChange={updateHandle} placeholder='Mobile' className='form-control' />
                  </div>
                  <div className="mb-2">
                    <input type="email" onChange={updateHandle} placeholder='Email' className='form-control' />
                  </div>
                  <div className="mb-2">
                    <input type="text" onChange={updateHandle} placeholder='Company' className='form-control' />
                  </div>
                  <div className="mb-2">
                    <input type="text" onChange={updateHandle} placeholder='Title' className='form-control' />
                  </div>
                  <div className="mb-2">
                    <select name="" id="" className='form-control'>
                      <option value="">Select A Group</option>
                    </select>
                  </div>

                  <div>
                    <input type="submit" value="Create" className="btn btn-primary"/>
                    <Link to={'/Contacts/list'} className='btn btn-danger ms-2'>Cancel</Link>
                  </div>
                </form>
              </div>
              <div className="col-md-6">
                <img src="https://img.freepik.com/free-vector/businessman-character-avatar-isolated_24877-60111.jpg?w=740&t=st=1726230511~exp=1726231111~hmac=61db9dba07cd25ba212fc3e18ea6ffc9b9cf4a2912cb76e75e0e8c9b92d6e76e" alt="" className='contact-img'/>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  )
}

export default EditContact
